import { createRouter, createWebHistory } from 'vue-router';
import Home from '../views/HomePage.vue';
import Shop from '../components/ShopPage.vue';

const routes = [
  {
    path: '/',
    name: 'Home',
    component: Home,
  },
  {
    path: '/shop',
    name: 'Shop',
    component: Shop,
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
